import classes from './MealsSummary.module.css';

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Delicious Delicacies, Delivered To You</h2>
      <p>
      Bacolod City in Negros Occidental is among the many places in the Philippines that you can never go wrong in
      buying local delicacies as pasalubongs.
      </p>
      <p>
      The City of Smiles offers several authentic treats that you can take home for you and your loved ones. 
      </p>
    </section>
  );
};

export default MealsSummary;
